pragma solidity >=0.7.0 <0.9.0;

contract RideShare {
    
    uint256 public rideCounter;
    uint256 public passengerCounter;

    struct Passenger {
        uint id;
        string name;
        string phoneNumber;
        string originAddress;
        string destAddress;
        uint256 numberOfPeople;
        string state;
    }

    struct Ride {
        uint id;
        address driver;
        uint256 drivingCost;
        uint256 capacity;
        uint256 confirmedAt;
        string originAddress;
        string destAddress;
        uint numOfPassengers; // S lng hnh khch hin ti
