        string memory _name,
        string memory _phoneNumber,
        uint256 _numberOfPeople,
        string memory _state,
        string memory _originAddress,
        string memory _destAddress
    ) public {
        // emit LogPassenger(_name, _phoneNumber, _numberOfPeople, _state);
        passengerCounter = passengerCounter + 1;

        Passenger memory newPassenger;
        newPassenger.id = passengerCounter;
        newPassenger.name = _name;
        newPassenger.phoneNumber = _phoneNumber;
        newPassenger.numberOfPeople = _numberOfPeople;
        newPassenger.state = _state;
        newPassenger.originAddress = _originAddress;
        newPassenger.destAddress = _destAddress;

        // Lu tr hnh khch vo mapping
        passengers[passengerCounter] = newPassenger;
        // Thm yu cu vo danh sch yu cu  to ca hnh khch
        createRequests[msg.sender].push(newPassenger.id);

        // emit PassengerAdded(psgCount, _name, _phoneNumber, _numberOfPeople, _state);
        // passengerCounter[msg.sender]++;
    }


    // Function to create a new ride
    function createRide (
        uint256 _drivingCost,
        uint256 _capacity,
        uint256 _confirmedAt,
        string memory _originAddress,
        string memory _destAddress
    ) public payable {
        // require(uint256(msg.value) == uint256(_drivingCost), "Create: Not enough ether!");
        // Tng s lng chuyn hin c
        rideCounter = rideCounter + 1;

        Ride memory newRide;
        newRide.id = rideCounter;
        newRide.driver = msg.sender;
        newRide.drivingCost = _drivingCost;
        newRide.capacity = _capacity;
        newRide.confirmedAt = _confirmedAt;
        newRide.originAddress = _originAddress;
        newRide.destAddress = _destAddress;
        newRide.numOfPassengers = 0;
        newRide.passengers;

        // startTime = block.timestamp;
        // Lu tr chuyn xe vo mapping
        rides[rideCounter] = newRide;
        // Thm chuyn xe vo danh sch chuyn i d to ca ti x
        createRides[msg.sender].push(newRide.id);
        numOfPendings[rideCounter] = 0;
        
    }

    function getCreateRides(address _driver) external view returns (uint[] memory) {
        return createRides[_driver];
    }

    function getRideDetails(uint _rideId) external view returns (uint256, uint256, uint256, string memory, string memory, uint256) {
        require(_rideId > 0 && _rideId <= rideCounter, "Invalid ride ID");
        Ride memory ride = rides[_rideId];
